function Intro() {
  return (
    <div>
      <div className="intro">
        {/* Profile Image */}
      <div className="intro-right">
        <img src="me.png" alt="Your Name" className="profile-image" />
      </div>
        <h1 className='intro-top'>
          Turning Vison Into Reality With Code And Design.
        </h1>
        <p className='intro-summarized'>
          As a skilled full-stack developer, I am dedicated to turning ideas into innovation web applications. Explore my leastest projects showcasing my expertise in React.js and web development.
        </p>
        {/* Resume Button */}
        <a href="assests/PloynapaYang(Resume)-2025.pdf" className="resume">
          <button>Resume</button>
        </a>

        {/* Contact Link */}
        <a href="mailto:ploy@ploynapa.com" className="contact">Contact</a>
      </div>
    </div>
  )
}

export default Intro;
